import React from 'react'
import { Route } from 'react-router-dom'
import Login from './Login'

export default function Main(props) {
  return (
    <main>
      <Route path='/login' render={(props) => (
        <Login
          {...props}
          setCurrentUser={props.setCurrentUser}
        />
      )} />


    </main>
  )
}
